// src/AdminDashboard.js
import React, { useState, useEffect } from 'react';
import AdminEmployees from './AdminEmployees';
import AdminParking from './AdminParking';
import AdminVehicles from './AdminVehicles';
import AdminEntries from './AdminEntries';
import { useNavigate } from 'react-router-dom';
import AdminExits from './AdminExits';
import AdminPayments from './AdminPayments';
import './AdminDashboard.css';
import {
  BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer, CartesianGrid, Legend,
} from 'recharts';

function AdminDashboard() {
  const [activePage, setActivePage] = useState('raporlar');
  const [sidebarOpen, setSidebarOpen] = useState(true);
  const [weeklyData, setWeeklyData] = useState(null);
  const [topVehicles, setTopVehicles] = useState([]);
  const [parkedVehicles, setParkedVehicles] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [user, setUser] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const storedUser = JSON.parse(localStorage.getItem('user'));
    if (!storedUser || !storedUser.id) {
      navigate('/');
      return;
    }
    setUser(storedUser);
  }, [navigate]);

  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
  };

  useEffect(() => {
    if (activePage === 'raporlar') {
      const fetchReportData = async () => {
        try {
          const [weeklyRes, topRes, parkedRes] = await Promise.all([
            fetch('/api/report/haftalik-giris'),
            fetch('/api/report/en-cok-kalanlar'),
            fetch('/api/parkedVehicles'),
          ]);

          setWeeklyData(await weeklyRes.json());
          setTopVehicles(await topRes.json());
          setParkedVehicles(await parkedRes.json());
          setLoading(false);
        } catch (err) {
          console.error('Veri hatası:', err);
          setError('Rapor verileri yüklenemedi.');
          setLoading(false);
        }
      };
      fetchReportData();
    }
  }, [activePage]);

  const renderCharts = () => (
    <div className="admin-report-charts">
      <div className="admin-chart-box">
        <h3>Günlük Giriş Sayısı</h3>
        <ResponsiveContainer width="100%" height={250}>
          <BarChart data={weeklyData?.entries || []}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="day" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Bar dataKey="count" fill="#007bff" name="Girişler" />
          </BarChart>
        </ResponsiveContainer>
      </div>
      <div className="admin-chart-box">
        <h3>Günlük Çıkış Sayısı</h3>
        <ResponsiveContainer width="100%" height={250}>
          <BarChart data={weeklyData?.exits || []}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="day" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Bar dataKey="count" fill="#dc3545" name="Çıkışlar" />
          </BarChart>
        </ResponsiveContainer>
      </div>
      <div className="admin-chart-box">
        <h3>Günlük Kazanç (TL)</h3>
        <ResponsiveContainer width="100%" height={250}>
          <BarChart data={weeklyData?.earnings || []}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="day" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Bar dataKey="amount" fill="#28a745" name="Kazanç" />
          </BarChart>
        </ResponsiveContainer>
      </div>
    </div>
  );

  return (
    <div className="admin-dashboard-container">
      <header className="admin-header">
        <h1>Admin Paneli</h1>
        <div className="admin-info">
          <span>{user?.name || 'Admin'}</span>
        </div>
      </header>
      <div className="admin-content">
        <aside className={`admin-sidebar ${sidebarOpen ? 'open' : 'closed'}`}>
          <button className="toggle-btn" onClick={toggleSidebar}>
            {sidebarOpen ? '<' : '>'}
          </button>
          {sidebarOpen && (
            <nav className="sidebar-nav">
              {['raporlar', 'calisanlar', 'otopark', 'araclar', 'girisler', 'cikislar', 'odemeler'].map((page) => (
                <li key={page} className={activePage === page ? 'active' : ''}>
                  <button onClick={() => setActivePage(page)}>
                    {page.charAt(0).toUpperCase() + page.slice(1)}
                  </button>
                </li>
              ))}
            </nav>
          )}
        </aside>

        <main className="admin-main">
          {activePage === 'raporlar' ? (
            <div className="admin-reports-content">
              {loading ? (
                <div>Yükleniyor...</div>
              ) : error ? (
                <div className="error">{error}</div>
              ) : (
                <>
                  {renderCharts()}
                  <div className="admin-tables-section">
                    <div className="admin-top-vehicles">
                      <h3>Otoparkta En Uzun Süre Kalan 5 Araç</h3>
                      <table>
                        <thead>
                          <tr>
                            <th>Plaka</th>
                            <th>Süre (dk)</th>
                          </tr>
                        </thead>
                        <tbody>
                          {topVehicles.map((v, i) => (
                            <tr key={i}>
                              <td>{v.arac_plaka}</td>
                              <td>{v.sure}</td>
                            </tr>
                          ))}
                        </tbody>
                      </table>
                    </div>
                    <div className="admin-parked-vehicles">
                      <h3>Şu Anda Otoparkta Olan Araçlar</h3>
                      <table>
                        <thead>
                          <tr>
                            <th>Plaka</th>
                            <th>Giriş Saati</th>
                          </tr>
                        </thead>
                        <tbody>
                          {parkedVehicles.map((v, i) => (
                            <tr key={i}>
                              <td>{v.plaka}</td>
                              <td>{v.giris_saat}</td>
                            </tr>
                          ))}
                        </tbody>
                      </table>
                    </div>
                  </div>
                </>
              )}
            </div>
          ) : activePage === 'calisanlar' ? (
            <AdminEmployees />
          ) : activePage === 'otopark' ? (
            <AdminParking />
          ) : activePage === 'araclar' ? (
            <AdminVehicles />
          ) : activePage === 'girisler' ? (
            <AdminEntries userId={user?.id} />
          ) : activePage === 'cikislar' ? (
            <AdminExits userId={user?.id} />
          ) : activePage === 'odemeler' ? (
            <AdminPayments userId={user?.id} />
          ) : (
            <div className="placeholder-page">
              <h2>{activePage.charAt(0).toUpperCase() + activePage.slice(1)} Sayfası</h2>
              <p>Bu sayfa henüz tasarlanmadı.</p>
            </div>
          )}
        </main>
      </div>
    </div>
  );
}

export default AdminDashboard;
